class errorHandler{
    rootComponent:string;
    errorState:boolean;
    //------------------------------------------------------------------------------------------------------------------
    constructor(rootComponent:string){
        this.rootComponent = rootComponent;
        this.errorState = false;
        document.traceStack = [];
        document.handler = this;
    }
    //------------------------------------------------------------------------------------------------------------------
    log(text:string|object){
        document.traceStack.push(new Date().toLocaleString()+" $ "+JSON.stringify(text));
        if(process.env.NODE_ENV !== "test") console.log(text);
    }
    //------------------------------------------------------------------------------------------------------------------
    info(text:string|object){
        document.traceStack.push(new Date().toLocaleString()+" @ "+JSON.stringify(text));
        if(process.env.NODE_ENV !== "test") console.info(text);
    }
    //------------------------------------------------------------------------------------------------------------------
    warn(text:string|object){
        document.traceStack.push(new Date().toLocaleString()+" ! "+JSON.stringify(text));
        if(process.env.NODE_ENV !== "test") console.warn(text);
    }
    //------------------------------------------------------------------------------------------------------------------
    debug(text:string|object){
        document.traceStack.push(new Date().toLocaleString+" ~ "+JSON.stringify(text));
        if(process.env.NODE_ENV !== "test") console.debug(text);
    }
    //------------------------------------------------------------------------------------------------------------------
    error(text:string|object){
        document.traceStack.push(new Date().toLocaleString()+" # "+JSON.stringify(text));
        if(process.env.NODE_ENV !== "test") console.error(text);
    }
    //------------------------------------------------------------------------------------------------------------------
    throw(){
        const target = document.getElementById(this.rootComponent);
        target.style.position = "fixed";
        target.style.top = "0px";
        target.style.left = "0px";
        target.style.right = "0px";
        target.style.bottom = "0px";
        target.style.display = "block";
        target.style.opacity = "1";
        target.style.backgroundImage = 'url(\'data:image/jpeg;base64,\')';
        target.innerHTML = "&nbsp;";
        target.style.backgroundPosition = "center center";
        target.style.backgroundSize = "cover";
        this.submit();
    }
    //------------------------------------------------------------------------------------------------------------------
    submit(){
        if(!this.errorState) {
            this.errorState = true;
            try {
                let body = "";
                document.traceStack.forEach(item => {
                    body += item.replace(/"/g, '') + "\n";
                });
                let xhr = new XMLHttpRequest();
                xhr.open("POST", process.env.REACT_APP_TRACE_URL, true);
                xhr.timeout = parseInt(process.env.REACT_APP_REQUEST_TIMEOUT)*1000;
                xhr.setRequestHeader("Content-Type", "text/plain; charset=utf-8");
                xhr.send(body);
                xhr.onreadystatechange = () => {
                    if (xhr.readyState !== 4) {
                        return false;
                    }
                    if (xhr.status !== 200) {
                        console.error("Unable to submit debug information");
                    } else {
                        console.error("Debug information sucessfully submited!");
                    }
                };
            }catch(e){
                console.error("Debug information submitting error -> "+e.message);
            }
        }
    }
}

export default errorHandler;